import './App.css';
import React from 'react'
import Navbar from './myComponent/Navbar';
import News from './myComponent/News';
import Footer from './myComponent/Footer';
import {BrowserRouter as Router, Switch, Route} from "react-router-dom@5";
const App=()=> {

    return (
      <div>

        <Navbar/>
        <Router>
        <Switch>

        <Route exact path="/"><News size={6} country="in" category="general"/></Route> 

        <Route exact path="/sport"><News size={6} country="in" category="sport"/></Route> 
        </Switch>
        </Router>
        <Footer/>
      </div>

    )

}
export default App;
